" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Isolated uncomplicated fracture of the medial malleolus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 331px; height: 576px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A fracture of the medial malleolus (white arrow) is clearly seen on this view. Care must be taken to exclude additional injuries (eg, proximal fibular fracture) commonly&nbsp;associated with fractures of the medial or posterior malleoli.",
"    <div class=\"footnotes\">",
