var title_f1_58_1965="Salient differences";
var content_f1_58_1965=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F76122&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F76122&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Salient differences in neonatal immune system in comparison to adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"2\" rowspan=\"1\">",
"       T-cells",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Overall number &gt; adults",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"3\">",
"       CD4+ cells",
"      </td>",
"      <td>",
"       Circulating number &gt; adults; preterms have higher numbers",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       80 to 90 percent are of naive phenotype (CD45 RA)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Possible immature, transitional stage",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       CD8+ cells",
"      </td>",
"      <td>",
"       Circulating number &lt; adults; no significant change with gestation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       CD4:CD8 ratio",
"      </td>",
"      <td>",
"       Higher than adults",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Proliferation",
"      </td>",
"      <td>",
"       Variable; comparable with mitogens (except in preterms), lower mixed lymphocte reaction, monoclonal antibody responses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"3\">",
"       Cytokine production",
"      </td>",
"      <td>",
"       Comparable proinflammatory cytokines",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Lower antiinflammatory cytokines",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Lower concentrations of cytokines involved in adaptive immunity",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Responses to antigens",
"      </td>",
"      <td>",
"       Variable",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Tolerance induction with superantigens",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       B-cell stimulation",
"      </td>",
"      <td>",
"       Poorer, with less cytokine secretion, lower CD40/CD40L interaction",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       CTLs",
"      </td>",
"      <td>",
"       Lower cytotoxicity",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       &Gamma; T-cells",
"      </td>",
"      <td>",
"       Lower cytotoxicity",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Limitations in repertoire",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"2\" rowspan=\"1\">",
"       B-cells",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Circulating B-cells",
"      </td>",
"      <td>",
"       Higher numbers than adults",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Mostly B1 phenotype",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"3\">",
"       Function Ig production",
"      </td>",
"      <td>",
"       Mostly IgM secreting",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Impaired isotype switching",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Inability to react to certain antigens",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"2\" rowspan=\"1\">",
"       NK cells",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Circulating NK cells",
"      </td>",
"      <td>",
"       Immature, transitional stage",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Function",
"      </td>",
"      <td>",
"       Lower cytolytic activity",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"2\" rowspan=\"1\">",
"       Monocytes and macrophages",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Circulating monocytes",
"      </td>",
"      <td>",
"       Relative monocytosis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"3\">",
"       Function",
"      </td>",
"      <td>",
"       Lower production of certain cytokines; diminished T-cell activation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Reduced chemotaxis. Phagocytosis, microbicidal activity comparable",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Diminished delayed-type hypersensitivity (DTH) skin test reactions to antigens",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"2\" rowspan=\"1\">",
"       Dendritic cells",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Function",
"      </td>",
"      <td>",
"       Poorer antigen presenting function and T-cell activation",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
